import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './Wrapper.css';
import city01 from '../../assets/images/city01.png';

const styles = {
  backgroundImage: "url(" + city01 + ")",
  backgroundSize: 'cover',
  width: '100%',
  height: '100vh',
}

class Wrapper extends Component {

  render() {
    return (
      <React.Fragment>
        <div className="overlay blue"></div>
        <div className="row wrapper" style={styles}>
        </div>
      </React.Fragment>
    )
  }
}

export default Wrapper;
